  {first_name: "Andy", last_name: "Bernard", email: "andy@bernard.com", phone_number: "12323423423423", middle_name: "Baines", bio: "Andrew Baines \"Andy\" Bernard (born in 1973; Walter Bernard, Jr.) is a fictional character from the U.S. comedy television series, The Office. Andy is portrayed by Ed Helms. He has no counterpart in the original British version of the series. He is introduced as the Regional Director in Charge of Sales at the Stamford branch of paper distribution company Dunder Mifflin in the third-season premiere when Jim Halpert transfers, ultimately merging with the Scranton branch in the episode \"The Merger\" later in the season. He becomes Regional Manager at the Scranton branch courtesy of Robert California in the eighth-season premiere following the departure of Michael Scott and Deangelo Vickers, although temporarily is fired and replaced by Nellie Bertram before his reinstatement by new CEO David Wallace. Although throughout the ninth season, Andy's relationship with Wallace deteriorates from Andy's lack of focus and professionalism, eventually culminating in Andy's voluntary resignation, to his reinstatement as a salesman to his eventual firing again, after Andy begs David Wallace to fire him in order to pursue a singing career. This all happens over the course of one day in \"Livin' the Dream\".\r\nHis character is insecure, seemingly due to a strained parental relationship, yet demonstrates self-centered and arrogant attitudes. He often references his education at Cornell University, where he was a part of an a cappella group, which contributed to his love for theatrical singing. Andy demonstrates a sycophantic attitude toward his superiors as well as severe anger management issues. He becomes involved in a long-term but failed relationship with accountant Angela Martin, but later finds a deeper connection with receptionist Erin Hannon. However, the relationship starts to sour throughout the ninth season and finally ends in \"Couples Discount\" when Erin gets fed up with Andy's neglect and selfishness."}
